// ---- 纯原生 Base64 解码到 Uint8Array ----
var _b64tab = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/";
function b64decodeToU8(str) {
  str = String(str).replace(/[^A-Za-z0-9\+\/\=]/g, '');
  var out = [];
  var i = 0;
  while (i < str.length) {
    var c1 = _b64tab.indexOf(str.charAt(i++));
    var c2 = _b64tab.indexOf(str.charAt(i++));
    var c3 = _b64tab.indexOf(str.charAt(i++));
    var c4 = _b64tab.indexOf(str.charAt(i++));
    var b1 = (c1 << 2) | (c2 >> 4); out.push(b1 & 255);
    if (c3 !== -1 && c3 !== 64) {
      var b2 = ((c2 & 15) << 4) | (c3 >> 2); out.push(b2 & 255);
    }
    if (c4 !== -1 && c4 !== 64) {
      var b3 = ((c3 & 3) << 6) | c4; out.push(b3 & 255);
    }
  }
  return new Uint8Array(out);
}

// ---- 保证 ArrayBuffer 紧凑（避免 subarray 偏移问题） ----
function toArrayBuffer(u8) {
  if (u8.byteOffset === 0 && u8.byteLength === u8.buffer.byteLength) return u8.buffer;
  var ab = new ArrayBuffer(u8.byteLength);
  new Uint8Array(ab).set(u8);
  return ab;
}

